e \'%\\\"case_status\\\":\\\"Sólo información\\\"%\',1,0)) new_open_cases,   SUM(IF (DATE(c.cdate) = report_date,1,0)) client_intake,      SUM(IF (DATE(c.cdate) = report_date and sys_data like \'%\\\"case_status\\\":\\\"Sólo información\\\"%\',1,0)) information_only,      SUM(IF (sys_data like CONCAT(\'%task_d_closed\\\":\\\"\',report_date,\'%\') and sys_data not like \'%\\\"closurereason_s\\\":\\\"Metas cumplidas\\\"%\',1,0)) closed_record_no_recovery_plan,   SUM(IF (sys_data like CONCAT(\'%task_d_closed\\\":\\\"\',report_date,\'%\') and sys_data like \'%\\\"closurereason_s\\\":\\\"Metas cumplidas\\\"%\',1,0)) closed_records_recovery_plan_complete,      SUM(IF (sys_data like CONCAT(\'%task_d_closed\\\":\\\"\',report_date,\'%\') and sys_data like \'%\\\"closurereason_s\\\":\\\"Metas parcialmente cumplidas, en transicion a otro proveedor de servicios%\',1,0)) closed_records_transitioning,   SUM(IF (sys_data like CONCAT(\'%task_d_closed\\\":\\\"\',report_date,\'%\') and sys_data like \'%\\\"closurereason_s\\\":\\\"Metas parcialmente cumplidas, recursos agotados\\\"%\',1,0)) closed_records_resources_exhaused,   SUM(IF (sys_data like CONCAT(\'%task_d_closed\\\":\\\"\',report_date,\'%\') and sys_data like \'%\\\"closurereason_s\\\":\\\"No se puede contactar cliente\\\"%\',1,0)) closed_records_no_longer_able_to_contact,   SUM(IF (sys_data like CONCAT(\'%task_d_closed\\\":\\\"\',report_date,\'%\') and sys_data like \'%\\\"closurereason_s\\\":\\\"Programa de desastre desactivado\\\"%\',1,0)) closed_records_deactivated,   SUM(IF (sys_data like CONCAT(\'%task_d_closed\\\":\\\"\',report_date,\'%\') and sys_data like \'%\\\"closurereason_s\\\":\\\"Disaster Survivor se ha retirado del manejo de caso\\\"%\',1,0)) closed_records_withdrawn,   SUM(IF (sys_data like CONCAT(\'%task_d_closed\\\":\\\"\',report_date,\'%\') and sys_data like \'%\\\"closurereason_s\\\":\\\"Disaster Survivore se ha mudado fuera del área de servicio\\\"%\',1,0)) closed_records_moved,   SUM(IF (data like \'%\\\"_addresstype\\\":323%\' AND (DATE(c.cdate) = report_date)    ,1,0) ) temporary_housing,   SUM(IF ((sys_data like \'%\\\"fematier\\\":\\\"Nivel 1%\') AND DATE(c.cdate) = report_date,1,0) ) fema_tier_1,   SUM(IF (sys_data like \'%\\\"fematier\\\":\\\"Nivel 2%\' AND DATE(c.cdate) = report_date,1,0) ) fema_tier_2,   SUM(IF (sys_data like \'%\\\"fematier\\\":\\\"Nivel 3%\' AND DATE(c.cdate) = report_date,1,0) ) fema_tier_3,   SUM(IF (sys_data like \'%\\\"fematier\\\":\\\"Nivel 4%\' AND DATE(c.cdate) = report_date,1,0) ) fema_tier_4   from objects,    rpt_clients c,      (select * from rpt_locations where rpt_locations.locationtype like \'%CONUS%\') l,      (select a.Date report_date from (    select curdate() - INTERVAL (a.a + (10 * b.a) + (100 * c.a)) DAY as Date    from (select 0 as a union all select 1 union all select 2 union all select 3 union all select 4 union all select 5 union all select 6 union all select 7 union all select 8 union all select 9) as a    cross join (select 0 as a union all select 1 union all select 2 union all select 3 union all select 4 union all select 5 union all select 6 union all select 7 union all select 8 union all select 9) as b    cross join (select 0 as a union all select 1 union all select 2 union all select 3 union all select 4 union all select 5 union all select 6 union all select 7 union all select 8 union all select 9) as c) a where a.Date between \'2018-04-20\' and \'2018-04-30\') reports   where       l.locationid = c.locationid and   objects.id = c.clientid      group by report_date ) a where a.report_dt is not null\",\n	\"DC\": {\n		\"report_dt\": {\n			\"solr_column_name\": \"report_dt\",\n			\"title\": \"Report Date\",\n			\"type\": \"date\",\n			\"width\": 100\n		},\n		\"total_cases_s\": {\n			\"solr_column_name\": \"total_cases_s\",\n			\"title\": \"Total Cases Entered in ECMRS\",\n			\"width\": 60\n		},\n		\"total_open_cases_s\": {\n			\"solr_column_name\": \"total_open_cases_s\",\n			\"title\": \"Total Open Cases\",\n