L),(246815,NULL,'email_reports','61769,39850',NULL),(246821,2726,'Daily Report - Location Totals','{\n    \"title\": \"Daily Report - Location Totals\",\n\"sql\": \"SELECT reports.locationid,       reports.locationname,       reports.report_date,       (SELECT count(*)        FROM users_groups        WHERE replace(replace(data, \'{\\\"user_location\\\":\\\"\', \'\'), \'\\\"\', \'\') =                 reports.locationid)          users_at_location,       disaster_survivors_served,       new_open_cases,       client_intake,       information_only,       updated_client_records,       closure_moved,       closure_deactivated,       closure_withdrawn,       closure_achieved,       closure_nocontact,       closure_exhausted,       closure_transitioning,       closure_total,       assessments_created,       notes_created,       referrals_created,       referrals_deleted,       referrals_updated,       family_members_created,       addresses_created,       assessment_date,       referrals_total,       referrals_behavioral,       referrals_child,       referrals_clothing,       referrals_employment,       referrals_fema,       referrals_financial,       referrals_food,       referrals_furniture,       referrals_health,       referrals_housing,       referrals_language,       referrals_legal,       referrals_senior,       referrals_transportation,       top_client_need,       second_client_need,       third_client_need,       tier_change_date,       new_tier_1,       new_tier_2,       new_tier_3,       new_tier_4,       change_tier_1,       change_tier_21,       change_tier_31,       change_tier_41,       change_tier_2,       change_tier_12,       change_tier_32,       change_tier_42,       change_tier_3,       change_tier_13,       change_tier_23,       change_tier_43,       change_tier_4,       change_tier_14,       change_tier_24,       change_tier_34,       tier_changes,       information_only_records,       active_records,       closed_records,       current_fema_tier_1,       current_fema_tier_2,       current_fema_tier_3,       current_fema_tier_4 FROM (SELECT DISTINCT             client_date   report_date,             rl.locationid,             rl.locationname,             SUM(                    IF(rpt_clients.case_status = \'Active\', 1, 0)                AND DATE_SUB(cdate, INTERVAL 6 HOUR) < client_date)                active_records,             SUM(                    IF(rpt_clients.case_status = \'Information Only\', 1, 0)                AND DATE_SUB(cdate, INTERVAL 6 HOUR) < client_date)                information_only_records,             SUM(                    IF(rpt_clients.case_status = \'Closed\', 1, 0)                AND DATE_SUB(cdate, INTERVAL 6 HOUR) < client_date)                closed_records,             SUM(                    IF(rpt_clients.fema_tier = ''tier 1\', 1, 0)                AND DATE_SUB(cdate, INTERVAL 6 HOUR) < client_date)                current_fema_tier_1,             SUM(                    IF(rpt_clients.fema_tier = ''tier 2\', 1, 0)                AND DATE_SUB(cdate, INTERVAL 6 HOUR) < client_date)                current_fema_tier_2,             SUM(                    IF(rpt_clients.fema_tier = ''tier 3\', 1, 0)                AND DATE_SUB(cdate, INTERVAL 6 HOUR) < client_date)                current_fema_tier_3,             SUM(                    IF(rpt_clients.fema_tier = ''tier 4\', 1, 0)                AND DATE_SUB(cdate, INTERVAL 6 HOUR) < client_date)                current_fema_tier_4      FROM (SELECT DISTINCT                   date(DATE_SUB(tree.action_time, INTERVAL 6 HOUR))                      client_date,                   rc.locationid            FROM action_log tree, rpt_clients rc, rpt_locations            WHERE     (   rc.clientid = tree.object_id                       OR rc.clientid = tree.object_pid)                  AND rpt_locations.locationid = rc.locationid) da,           rpt_clients,           rpt_locations      rl      WHERE     rl.locationid = rpt_clients.locationid            AND rl.locationid = da.locationid      GROUP BY client_date, rl.locationid) reports     LEFT OUTER JOIN     (SELECT locationid,             date(DATE_SUB(action_log.action_time, INTERVAL 6 HOUR))                report_date,             count(DISTINCT clientid)   disaster_survivors_served,             SUM(                IF(                       action_log.object_pid = 150                   AND action_log.action_type = \'create\'                   AND c.case_status NOT LIKE \'Information Only\',                   1,                   0))                new_open_cases,             SUM(                IF(                       action_log.object_pid = 150                   AND action_log.action_type = \'create\',                   1,                   0))                client_intake,             SUM(                IF(                       action_log.object_pid = 150                   AND action_log.action_type = \'create\'                   AND c.case_status LIKE \'Information Only\',                   1,                   0))                information_only,             SUM(                IF(                       action_log.object_pid = 150                   AND action_log.action_type = \'update\',                   1,                   0))                updated_client_records,             SUM(                IF(                       action_log.object_pid <> 150                   AND je(action_log.data, ''template_id\') IN (527)                   AND je(action_log.data, \'name\') LIKE                          \'%Close Record Disaster Survivor has moved out of service area%\'                   AND action_log.action_type = \'create\',                   1,                   0))                closure_moved,             SUM(                IF(                       action_log.object_pid <> 150                   AND je(action_log.data, ''template_id\') IN (527)                   AND je(action_log.data, \'name\') LIKE                          \'%Close Record Disaster program deactivated%\'                   AND action_log.action_type = \'create\',                   1,                   0))                closure_deactivated,             SUM(                IF(                       action_log.object_pid <> 150                   AND je(action_log.data, ''template_id\') IN (527)                   AND je(action_log.data, \'name\') LIKE                          \'%Close Record Disaster Survivor has withdrawn%\'                   AND action_log.action_type = \'create\',                   1,                   0))                closure_withdrawn,             SUM(                IF(                       action_log.object_pid <> 150                   AND je(action_log.data, ''template_id\') IN (527)                   AND je(action_log.data, \'name\') LIKE                          \'%Close Record Goals achieved%\'                   AND action_log.action_type = \'create\',                   1,                   0))                closure_achieved,             SUM(                IF(                       action_log.object_pid <> 150                   AND je(action_log.data, ''template_id\') IN (527)                   AND je(action_log.data, \'name\') LIKE                          \'%Close Record No longer able to contact%\'                   AND action_log.action_type = \'create\',                   1,                   0))                closure_nocontact,             SUM(                IF(                       action_log.object_pid <> 150                   AND je(action_log.data, ''template_id\') IN (527)                   AND je(action_log.data, \'name\') LIKE                          \'%resources have been exhausted%\'                   AND action_log.action_type = \'create\',                   1,                   0))                closure_exhausted,             SUM(                IF(                       action_log.object_pid <> 150                   AND je(action_log.data, ''template_id\') IN (527)                   AND je(action_log.data, \'name\') LIKE                          \'%transitioning to other%\'                   AND action_log.action_type = \'create\',                   1,                   0))                closure_transitioning,             SUM(                IF(                       action_log.object_pid <> 150                   AND je(action_log.data, ''template_id\') IN (527)                   AND je(action_log.data, \'name\') LIKE \'%Close Record%\'                   AND action_log.action_type = \'create\',                   1,                   0))                closure_total,             SUM(IF(    action_log.object_pid <> 150                    AND je(action_log.data, ''template_id\') IN (3114,                                                               1175,                                                               1120,                                                               656,                                                               651,                                                               559,                                                               553,                                                               533,                                                               510,                                                               505,                                                               489,                                                               482,                                                               455,                                                               440,                                                               172)                    AND action_log.action_type = \'create\',                    1,                    0))                assessments_created,             SUM(                IF(                       action_log.object_pid <> 150                   AND je(action_log.data, ''template_id\') IN (527)                   AND action_log.action_type = \'create\',                   1,                   0))                notes_created,             SUM(                IF(                       action_log.object_pid <> 150                   AND je(action_log.data, ''template_id\') IN (607)                   AND action_log.action_type = \'create\',                   1,                   0))                referrals_created,             SUM(                IF(                       action_log.object_pid <> 150                   AND je(action_log.data, ''template_id\') IN (607)                   AND action_log.action_type = \'delete\',                   1,                   0))                referrals_deleted,             SUM(                IF(                       action_log.object_pid <> 150                   AND je(action_log.data, ''template_id\') IN (607)                   AND action_log.action_type = \'update\',                   1,                   0))                referrals_updated,             SUM(                IF(                       action_log.object_pid <> 150                   AND je(action_log.data, ''template_id\') IN (289)                   AND action_log.action_type = \'create\',                   1,                   0))                family_members_created,             SUM(                IF(                       action_log.object_pid <> 150                   AND je(action_log.data, ''template_id\') IN (311)                   AND action_log.action_type = \'create\',                   1,                   0))                addresses_created      FROM action_log, rpt_clients c      WHERE    (c.clientid = action_log.object_id)            OR (c.clientid = action_log.object_pid)      GROUP BY locationid,               date(DATE_SUB(action_log.action_time, INTERVAL 6 HOUR))) c        ON     c.locationid = reports.locationid           AND date(reports.report_date) = date(c.report_date)     LEFT OUTER JOIN     (SELECT assessments.*,             (SELECT SUBSTR(rt.name, 1, LOCATE(\'-\', rt.name) - 1)              FROM rpt_clients rc, tree rt              WHERE     rt.template_id = 607                    AND rt.name NOT LIKE \'%-  []%\'                    AND rt.dstatus = 0                    AND rt.pid = rc.clientid                    AND rc.locationid = assessments.locationid                    AND date(rt.cdate) = date(assessments.assessment_date)              GROUP BY SUBSTR(rt.name, 1, LOCATE(\'-\', rt.name) - 1)              ORDER BY count(*) DESC              LIMIT 0, 1)                top_client_need,             (SELECT SUBSTR(rt.name, 1, LOCATE(\'-\', rt.name) - 1)              FROM rpt_clients rc, tree rt              WHERE     rt.template_id = 607                    AND rt.name NOT LIKE \'%-  []%\'                    AND rt.dstatus = 0                    AND rt.pid = rc.clientid                    AND rc.locationid = assessments.locationid                    AND date(rt.cdate) = date(assessments.assessment_date)              GROUP BY SUBSTR(rt.name, 1, LOCATE(\'-\', rt.name) - 1)              ORDER BY count(*) DESC              LIMIT 1, 1)                second_client_need,             (SELECT SUBSTR(rt.name, 1, LOCATE(\'-\', rt.name) - 1)              FROM rpt_clients rc, tree rt              WHERE     rt.template_id = 607                    AND rt.name NOT LIKE \'%-  []%\'                    AND rt.dstatus = 0                    AND rt.pid = rc.clientid                    AND rc.locationid = assessments.locationid                    AND date(rt.cdate) = date(assessments.assessment_date)              GROUP BY SUBSTR(rt.name, 1, LOCATE(\'-\', rt.name) - 1)              ORDER BY count(*) DESC              LIMIT 2, 1)                third_client_need      FROM (SELECT rpt_locations.locationid,                   date(tree.cdate)                           assessment_date,                   SUM(IF(name NOT LIKE \'%-  []%\', 1, 0))     referrals_total,                   SUM(IF(name LIKE \'Behavioral Health%\', 1, 0))                      referrals_behavioral,                   SUM(IF(name LIKE \'Child%\', 1, 0))          referrals_child,                   SUM(IF(name LIKE \'Clothing%\', 1, 0))                      referrals_clothing,                   SUM(IF(name LIKE \'Employment%\', 1, 0))                      referrals_employment,                   SUM(IF(name LIKE \'FEMA%\', 1, 0))           referrals_fema,                   SUM(IF(name LIKE \'Financial%\', 1, 0))                      referrals_financial,                   SUM(IF(name LIKE \'Food%\', 1, 0))           referrals_food,                   SUM(IF(name LIKE \'Furniture%\', 1, 0))                      referrals_furniture,                   SUM(IF(name LIKE \'Health%\', 1, 0))                      referrals_health,                   SUM(IF(name LIKE \'Housing%\', 1, 0))                      referrals_housing,                   SUM(IF(name LIKE \'Language%\', 1, 0))                      referrals_language,                   SUM(IF(name LIKE \'Legal Services%\', 1, 0))                      referrals_legal,                   SUM(IF(name LIKE ''senior Services%\', 1, 0))                      referrals_senior,                   SUM(IF(name LIKE ''transportation%\', 1, 0))                      referrals_transportation            FROM rpt_clients, rpt_locations, tree            WHERE     template_id = 607                  AND name NOT LIKE \'%-  []%\'                  AND dstatus = 0                  AND pid = rpt_clients.clientid                  AND rpt_locations.locationid = rpt_clients.locationid            GROUP BY date(cdate), rpt_locations.locationid) assessments)     a        ON     a.locationid = reports.locationid           AND date(reports.report_date) = date(a.assessment_date)     LEFT OUTER JOIN     (SELECT locationid,             date(DATE_SUB(action_time, INTERVAL 6 HOUR))   tier_change_date,             SUM(                CASE                   WHEN (real_old_value IS NULL AND new_value = 1325)                   THEN                      1                   ELSE                      0                END)                new_tier_1,             SUM(                CASE                   WHEN (real_old_value IS NULL AND new_value = 1326)                   THEN                      1                   ELSE                      0                END)                new_tier_2,             SUM(                CASE                   WHEN (real_old_value IS NULL AND new_value = 1327)                   THEN                      1                   ELSE                      0                END)                new_tier_3,             SUM(                CASE                   WHEN (real_old_value IS NULL AND new_value = 1328)                   THEN                      1                   ELSE                      0                END)                new_tier_4,             SUM(                CASE                   WHEN (real_old_value IS NOT NULL AND new_value = 1325)                   THEN                      1                   ELSE                      0                END)                change_tier_1,             SUM(                CASE                   WHEN (real_old_value = 1326 AND new_value = 1325) THEN 1                   ELSE 0                END)                change_tier_21,             SUM(                CASE                   WHEN (real_old_value = 1327 AND new_value = 1325) THEN 1                   ELSE 0                END)                change_tier_31,             SUM(                CASE                   WHEN (real_old_value = 1328 AND new_value = 1325) THEN 1                   ELSE 0                END)                change_tier_41,             SUM(                CASE                   WHEN (real_old_value IS NOT NULL AND new_value = 1326)                   THEN                      1                   ELSE                      0                END)                change_tier_2,             SUM(                CASE                   WHEN (real_old_value = 1325 AND new_value