uilaban un casa que sufrió daños menores en su infraestructura pero por dentro la casa se inundó y perdieron sus cosas personales.La sobreviviente de desastre no tenía seguro de propiedad. La sobreviviente de desastre mando una solicitud de asistencia a FEMA por daños personales pero se le fue negada porque no había un familiar para darle permiso al inspector de inspeccionar la casa porque la familia ya había sido evacuada a Boston, Massachusetts. La familia actualmente se encuentra viviendo en un hotel recibiendo los beneficios de TSA( Asistencia de Alojamiento Transitoria) con caducidad el 14 de Febrero del 2018. El sobreviviente de desastre no tiene familiares ni amigos en el área que los puedan asistir con un hogar donde quedarse.El sobreviviente de desastre se encuentra desempleado y con bajos recursos. El sobreviviente de desastre vino al centro de recursos de familia para solicitar asistencia con sus necesidades. El agente de caso lo refirió al salvation army para asistirlo con ropa , le encontró una organización que dona diferentes prendas a niños menores de 14 años (Cradles and crayons) y le dio diferente ropa y artículos personales que regala el centro de recursos de familia.Le asistio en llenar varias aplicaciones de vivenda en el estado de Massachusetts. La asistió con su caso de FEMA dando orientación sobre su caso, llamando a FEMA, checando qué documentación necesitan para proceder con su caso y ayudándoles a hacer una cuenta por línea para checar el status de su solicitud.La situacion de la sobreviviente de desastre es que hasta el momento un inspector no a podido ir a inspeccionar la vivienda. La familia tiene seguro medico de Masshealth y beneficios del Programa Suplementario de Asistencia Nutricional (SNAP).El agente de caso también les va a asistir en conseguir 2 pasajes de transporte público para usar en la ciudad de Boston, Massachusetts.El sobreviviente de desastre declinó asistencia con salud mental,finanzas y comida por que estas necesidades ya están satisfechas. El agente de caso seguirá en contacto con la sobreviviente de desastre para darles la ropa, pasajes y revisar si obtuvieron más artículos del salvation army así como si en un futuro llegan a tener otra necesidad. El administrador de casos le imprimió su plan de recuperación,lo firmó y se le entregó.  \\n\\n\\n\"}','{\"wu\":[],\"solr\":{\"content\":\"2018-01-26T05:00:00.000Z\\n1836\\nLa sobreviviente de desastre arribo al Centro de Recursos de Familia en Boston,MA el dia 26 de Enero del 2018 para solicitar asistencia con ropa, información de FEMA y transporte.El administrador de casos le explico y le leyó la forma de consentimiento al sobreviviente de desastre el estuvo de acuerdo con los términos y la firmó enfrente del administrador de casos. La sobreviviente de desastre y su familia de 4 fueron afectados por el huracán Maria en Puerto Rico(DN-4339). Ellos alquilaban un casa que sufrió daños menores en su infraestructura pero por dentro la casa se inundó y perdieron sus cosas personales.La sobreviviente de desastre no tenía seguro de propiedad. La sobreviviente de desastre mando una solicitud de asistencia a FEMA por daños personales pero se le fue negada porque no había un familiar para darle permiso al inspector de inspeccionar la casa porque la familia ya había sido evacuada a Boston, Massachusetts. La familia actualmente se encuentra viviendo en un hotel recibiendo los beneficios de TSA( Asistencia de Alojamiento Transitoria) con caducidad el 14 de Febrero del 2018. El sobreviviente de desastre no tiene familiares ni amigos en el área que los puedan asistir con un hogar donde quedarse.El sobreviviente de desastre se encuentra desempleado y con bajos recursos. El sobreviviente de desastre vino al centro de recursos de familia para solicitar asistencia con sus necesidades. El agente de caso lo refirió al salvation army para asistirlo con ropa , le encontró una organización que dona diferentes prendas a niños menores de 14 años (Cradles and c