r daños personales pero se le fue negada porque no había un familiar para darle permiso al inspector de inspeccionar la casa porque la familia ya había sido evacuada a Boston, Massachusetts. La familia actualmente se encuentra viviendo en un hotel recibiendo los beneficios de TSA( Asistencia de Alojamiento Transitoria) con caducidad el 14 de Febrero del 2018. El sobreviviente de desastre no tiene familiares ni amigos en el área que los puedan asistir con un hogar donde quedarse.El sobreviviente de desastre se encuentra desempleado y con bajos recursos. El sobreviviente de desastre vino al centro de recursos de familia para solicitar asistencia con sus necesidades. El agente de caso lo refirió al salvation army para asistirlo con ropa , le encontró una organización que dona diferentes prendas a niños menores de 14 años (Cradles and crayons) y le dio diferente ropa y artículos personales que regala el centro de recursos de familia.Le asistio en llenar varias aplicaciones de vivenda en el estado de Massachusetts. La asistió con su caso de FEMA dando orientación sobre su caso, llamando a FEMA, checando qué documentación necesitan para proceder con su caso y ayudándoles a hacer una cuenta por línea para checar el status de su solicitud.La situacion de la sobreviviente de desastre es que hasta el momento un inspector no a podido ir a inspeccionar la vivienda. La familia tiene seguro medico de Masshealth y beneficios del Programa Suplementario de Asistencia Nutricional (SNAP).El agente de caso también les va a asistir en conseguir 2 pasajes de transporte público para usar en la ciudad de Boston, Massachusetts.El sobreviviente de desastre declinó asistencia con salud mental,finanzas y comida por que estas necesidades ya están satisfechas. El agente de caso seguirá en contacto con la sobreviviente de desastre para darles la ropa, pasajes y revisar si obtuvieron más artículos del salvation army así como si en un futuro llegan a tener otra necesidad. El administrador de casos le imprimió su plan de recuperación,lo firmó y se le entregó.  \\n\\n\\n\"},\"lastAction\":{\"type\":\"update\",\"users\":{\"556\":\"474648\"},\"time\":\"2018-03-05T17:01:08Z\"}}'),(193245,'{\"_entrydate\":\"2018-01-27T04:00:00.000Z\",\"_notetype\":1836,\"_casenote\":\"El administrador de casos se presentó en el Hotel Baymont Inn & Suites el dia  27 de Enero de 2018, para una  evaluación inicial de las necesidades relacionadas con el desastre del sobreviviente. El sobreviviente indicó  que fue afectado por el Huracán Maria e indicó que perdio todo lo que tenia dentro del  apartamento que rentaba. El sobreviviente de desastre indicó que el departamento donde él vivía se inundó hasta el techo y tuvo que salir de emergencia con su familia. \\n\\nEl sobreviviente de Desastre no ah recibido dinero de FEMA, pero está en contacto con FEMA para la asistencia de renta. El sobreviviente tiene entendido que FEMA le otorgara la asistencia de renta tan pronto entregue la prueba de donde rentaba en Puerto Rico. El sobreviviente indicó tan pronto esta semana FEMA le apruebe la asistencia de renta el buscara un apartamento. El sobreviviente de desastre indicó que el dueño del apartamento no se a prestado oh ayudado para que el inspector de FEMA inspecte el departamento donde el sobreviviente vivía.  El sobreviviente de desastre no ah regresado a Puerto Rico a ver el apartamento desde el desastre. \\n\\nEl sobreviviente de desastre estará en el hotel Baymont Inn hasta el 14 de Febrero. El sobreviviente indicó que el piensa que para entonces él estará en un departamento. \\n\\n\\nEl sobreviviente de desastre indicó que el ya está trabajando cercas del hotel donde vive. El sobreviviente de desastre no está interesado en ayuda financiera, comida y en consejería en el momento. El sobreviviente si está interesado en muebles tan pronto tenga su apartamento en Tampa, Florida.\\n\\nEl administrador de casos contactara al sobreviviente de desastre aproximadamente una semana.\"}','{\"wu\":[],\"solr\":{\"content\":\"2018-01-27T04:00:00.000Z\\n1836\\nEl administrador de casos se presentó en el Hotel Baymont Inn & Suites el dia  27 de Enero de 2018, para una  evaluación inicial de las necesidades relacionadas con el desastre del sobreviviente. El sobreviviente indicó  que fue afectado por el Huracán Maria e indicó que perdio todo lo que tenia dentro del  apartamento que rentaba. El sobreviviente de desastre indicó que el departamento donde él vivía se inundó hasta el techo y tuvo que salir de emergencia con su familia. \\n\\nEl sobreviviente de Desastre no ah recibido dinero de FEMA, pero está en contacto con FEMA para la asistencia de renta. El sobreviviente tiene entendido que FEMA le otorgara la asistencia de renta tan pronto entregue la prueba de donde rentaba en Puerto Rico. El sobreviviente indicó tan pronto esta semana FEMA le apruebe la asistencia de renta el buscara un apartamento. El sobreviviente de desastre indicó que el dueño del apartamento no se a prestado oh ayudado para que el inspector de FEMA inspecte el departamento donde el sobreviviente vivía.  El sobreviviente de desastre no ah regresado a Puerto Rico a ver el apartamento desde el desastre. \\n\\nEl sobreviviente de desastre estará en el hotel Baymont Inn hasta el 14 de Febrero. El sobreviviente indicó que el piensa que para entonces él estará en un departamento. \\n\\n\\nEl sobreviviente de desastre indicó que el ya está trabajando cercas del hotel donde vive. El sobreviviente de desastre no está interesado en ayuda financiera, comida y en consejería en el momento. El sobreviviente si está interesado en muebles tan pronto tenga su apartamento en Tampa, Florida.\\n\\nEl administrador de casos contactara al sobreviviente de desastre aproximadamente una semana.\\n\",\"casenote_ss\":\"El administrador de casos se presentó en el Hotel Baymont Inn & Suites el dia  27 de Enero de 2018, para una  evaluación inicial de las necesidades relacionadas con el desastre del sobreviviente. El sobreviviente indicó  que fue afectado por el Huracán Maria e indicó que perdio todo lo que tenia dentro del  apartamento que rentaba. El sobreviviente de desastre indicó que el departamento donde él vivía se inundó hasta el techo y tuvo que salir de emergencia con su familia. \\n\\nEl sobreviviente de Desastre no ah recibido dinero de FEMA, pero está en contacto con FEMA para la asistencia de renta. El sobreviviente tiene entendido que FEMA le otorgara la asistencia de renta tan pronto entregue la prueba de donde rentaba en Puerto Rico. El sobreviviente indicó tan pronto esta semana FEMA le apruebe la asistencia de renta el buscara un apartamento. El sobreviviente de desastre indicó que el dueño del apartamento no se a prestado oh ayudado para que el inspector de FEMA inspecte el departamento donde el sobreviviente vivía.  El sobreviviente de desastre no ah regresado a Puerto Rico a ver el apartamento desde el desastre. \\n\\nEl sobreviviente de desastre estará en el hotel Baymont Inn hasta el 14 de Febrero. El sobreviviente indicó que el piensa que para entonces él estará en un departamento. \\n\\n\\nEl sobreviviente de desastre indicó que el ya está trabajando cercas del hotel donde vive. El sobreviviente de desastre no está interesado en ayuda financiera, comida y en consejería en el momento. El sobreviviente si está interesado en muebles tan pronto tenga su apartamento en Tampa, Florida.\\n\\nEl administrador de casos contactara al sobreviviente de desastre aproximadamente una semana.\"},\"lastAction\":{\"type\":\"update\",\"users\":{\"611\":\"348232\"},\"time\":\"2018-01-28T16:49:46Z\"}}'),(193247,'{\"_assessmentdate\":\"2018-01-27T00:00:00Z\",\"_predisasterliving\":338,\"_damagedhouse\":3108,\"_accessiblehouse\":347,\"_livablehouse\":347,\"_clientdamagerating\":3228,\"_clientrelocated\":{\"value\":347,\"childs\":{\"_planstoreturn\":\"El cliente desea quedarse permanente aqui en Springfield, MA.\"}},\"_utilitieswork\":347,\"_disasterImpacts\":\"El cliente vivie con su mama y ella era la duena de la propiedad.\",\"_predisasterinsurance\":379,\"_referralneeded\":{\"value\":686,\"childs\":{\"_referralservice\":\"1388\"}}}','{\"wu\":[],\"solr\":{\"content\":\"El cliente desea quedarse permanente aqui en Springfield, MA.\\n1388\\n2018-01-27T00:00:00Z\\n338\\n3108\\n347\\n347\\n3228\\n347\\n347\\nEl cliente vivie con su mama y ella era la duena de la propiedad.\\n379\\n686\\n\"},\"lastAction\":{\"type\":\"create\",\"time\":\"2018-01-27T16:29:05Z\",\"users\":{\"567\":\"343139\"}}}'),(229734,'{\"_title\":\"FEMA Closure Report\",\"value\":\"{\\r\\n\\\"title\\\": \\\"FEMA Closure Report By Day\\\",\\r\\n\\\"sql\\\":\\\"select SUM(case when je(sys_data,\'closurereason_s\') = \'No longer able to contact disaster survivor\' then 1 else 0 end) closed_records_no_longer_able_to_contact_s,SUM(case when je(sys_data,\'closurereason_s\') = \'Disaster program deactivated\' then 1 else 0 end) closed_records_deactivated_s,SUM(case when je(sys_data,\'closurereason_s\') = \'Repatriate has moved out of service area\' then 1 else 0 end) closed_records_moved_s,SUM(case when je(sys_data,\'closurereason_s\') = \'Repatriate has withdrawn from case management\' then 1 else 0 end) closed_records_withdrawn_s,SUM(case when je(sys_data,\'closurereason_s\') = \'Partial goals met, transitioning to other service provider\' then 1 else 0 end) closed_records_transitioning_s,SUM(case when je(sys_data,\'closurereason_s\') = \'Partial goals met, resources have been exhausted\' then 1 else 0 end) closed_records_resources_exhaused_s,SUM(case when je(sys_data,\'closurereason_s\') = \'Goals achieved\' then 1 else 0 end) closed_records_recovery_plan_complete_s,CONCAT(substring(je(sys_data,''task_d_closed\'),1,10),''t00:00:00Z\') report_dt, count(*) closed_cases_s from objects where id in (select id from tree where template_id= 141 and dstatus = 0) and sys_data like \'%task_d_closed%\' group by CONCAT(substring(je(sys_data,''task_d_closed\'),1,10),''t00:00:00Z\')\\\",\\r\\n\\