819,'{\"en\":\"Successful Contact with Survivor\"}','{\"wu\":[],\"solr\":{\"content\":\"Successful Contact with Survivor\\n\"},\"lastAction\":{\"type\":\"create\",\"time\":\"2019-04-01T19:38:08Z\",\"users\":{\"1\":\"531847\"}}}'),(246820,'{\"report_date\":\"2019-04-04T00:00:00Z\"}','{\"wu\":[],\"solr\":{\"content\":\"2019-04-04T00:00:00Z\\n\",\"report_dt\":\"2019-04-04T00:00:00Z\"},\"lastAction\":{\"type\":\"create\",\"time\":\"2019-04-05T12:49:24Z\",\"users\":{\"1\":\"531848\"}}}'),(246821,'{\"_title\":\"Daily Report - Location Totals\",\"value\":\"{\\n    \\\"title\\\": \\\"Daily Report - Location Totals\\\",\\n\\\"sql\\\": \\\"SELECT reports.locationid,       reports.locationname,       reports.report_date,       (SELECT count(*)        FROM users_groups        WHERE replace(replace(data, \'{\\\\\\\"user_location\\\\\\\":\\\\\\\"\', \'\'), \'\\\\\\\"\', \'\') =                 reports.locationid)          users_at_location,       disaster_survivors_served,       new_open_cases,       client_intake,       information_only,       updated_client_records,       closure_moved,       closure_deactivated,       closure_withdrawn,       closure_achieved,       closure_nocontact,       closure_exhausted,       closure_transitioning,       closure_total,       assessments_created,       notes_created,       referrals_created,       referrals_deleted,       referrals_updated,       family_members_created,       addresses_created,       assessment_date,       referrals_total,       referrals_behavioral,       referrals_child,       referrals_clothing,       referrals_employment,       referrals_fema,       referrals_financial,       referrals_food,       referrals_furniture,       referrals_health,       referrals_housing,       referrals_language,       referrals_legal,       referrals_senior,       referrals_transportation,       top_client_need,       second_client_need,       third_client_need,       tier_change_date,       new_tier_1,       new_tier_2,       new_tier_3,       new_tier_4,       change_tier_1,       change_tier_21,       change_tier_31,       change_tier_41,       change_tier_2,       change_tier_12,       change_tier_32,       change_tier_42,       change_tier_3,       change_tier_13,       change_tier_23,       change_tier_43,       change_tier_4,       change_tier_14,       change_tier_24,       change_tier_34,       tier_changes,       information_only_records,       active_records,       closed_records,       current_fema_tier_1,       current_fema_tier_2,       current_fema_tier_3,       current_fema_tier_4 FROM (SELECT DISTINCT             client_date   report_date,             rl.locationid,             rl.locationname,             SUM(                    IF(rpt_clients.case_status = \'Active\', 1, 0)                AND DATE_SUB(cdate, INTERVAL 6 HOUR) < client_date)                active_records,             SUM(                    IF(rpt_clients.case_status = \'Information Only\', 1, 0)                AND DATE_SUB(cdate, INTERVAL 6 HOUR) < client_date)                information_only_records,             SUM(                    IF(rpt_clients.case_status = \'Closed\', 1, 0)                AND DATE_SUB(cdate, INTERVAL 6 HOUR) < client_date)                closed_records,             SUM(                    IF(rpt_clients.fema_tier = ''tier 1\', 1, 0)                AND DATE_SUB(cdate, INTERVAL 6 HOUR) < client_date)                current_fema_tier_1,             SUM(                    IF(rpt_clients.fema_tier = ''tier 2\', 1, 0)                AND DATE_SUB(cdate, INTERVAL 6 HOUR) < client_date)                current_fema_tier_2,             SUM(                    IF(rpt_clients.fema_tier = ''tier 3\', 1, 0)                AND DATE_SUB(cdate, INTERVAL 6 HOUR) < client_date)                current_fema_tier_3,             SUM(                    IF(rpt_clients.fema_tier = ''tier 4\', 1, 0)                AND DATE_SUB(cdate, INTERVAL 6 HOUR) < client_date)                current_fema_tier_4      FROM (SELECT DISTINCT                   date(DATE_SUB(tree.action_time, INTERVAL 6 HOUR))                      client_date,                   rc.locationid            FROM action_log tree, rpt_clients rc, rpt_locations            WHERE     (   rc.clientid = tree.object_id                       OR rc.clientid = tree.object_pid)                  AND rpt_locations.locationid = rc.locationid) da,           rpt_clients,           rpt_locations      rl      WHERE     rl.locationid = rpt_clients.locationid            AND rl.locationid = da.locationid      GROUP BY client_date, rl.locationid) reports     LEFT OUTER JOIN     (SELECT locationid,             date(DATE_SUB(action_log.action_time, INTERVAL 6 HOUR))                report_date,             count(DISTINCT clientid)   disaster_survivors_served,             SUM(                IF(                       action_log.object_pid = 150                   AND action_log.action_type = \'create\'                   AND c.case_status NOT LIKE \'Information Only\',                   1,                   0))                new_open_cases,             SUM(                IF(                       action_log.object_pid = 150                   AND action_log.action_type = \'create\',                   1,                   0))                client_intake,             SUM(                IF(                       action_log.object_pid = 150                   AND action_log.action_type = \'create\'                   AND c.case_status LIKE \'Information Only\',                   1,                   0))                information_only,             SUM(                IF(                       action_log.object_pid = 150                   AND action_log.action_type = \'update\',                   1,                   0))                updated_client_records,             SUM(                IF(                       action_log.object_pid <> 150                   AND je(action_log.data, ''template_id\') IN (527)                   AND je(action_log.data, \'name\') LIKE                          \'%Close Record Repatriate has moved out of service area%\'                   AND action_log.action_type = \'create\',                   1,                   0))                closure_moved,             SUM(                IF(                       action_log.object_pid <> 150                   AND je(action_log.data, ''template_id\') IN (527)                   AND je(action_log.data, \'name\') LIKE                          \'%Close Record Disaster program deactivated%\'                   AND action_log.action_type = \'create\',                   1,                   0))                closure_deactivated,             SUM(                IF(                       action_log.object_pid <> 150                   AND je(action_log.data, ''template_id\') IN (527)                   AND je(action_log.data, \'name\') LIKE                          \'%Close Record Repatriate has withdrawn%\'                   AND action_log.action_type = \'create\',                   1,                   0))                closure_withdrawn,             SUM(                IF(                       action_log.object_pid <> 150                   AND je(action_log.data, ''template_id\') IN (527)                   AND je(action_log.data, \'name\') LIKE                          \'%Close Record Goals achieved%\'                   AND action_log.action_type = \'create\',                   1,                   0))                closure_achieved,             SUM(                IF(                       action_log.object_pid <> 150                   AND je(action_log.data, ''template_id\') IN (527)                   AND je(action_log.data, \'name\') LIKE                          \'%Close Record No longer able to contact%\'                   AND action_log.action_type = \'create\',                   1,                   0))                closure_nocontact,             SUM(                IF(                       action_log.object_pid <> 150                   AND je(action_log.data, ''template_id\') IN (527)                   AND je(action_log.data, \'name\') LIKE                          \'%resources have been exhausted%\'                   AND action_log.action_type = \'create\',                   1,                   0))                closure_exhausted,             SUM(                IF(                       action_log.object_pid <> 150                   AND je(action_log.data, ''template_id\') IN (527)                   AND je(action_log.data, \'name\') LIKE                          \'%transitioning to other%\'                   AND action_log.action_type = \'create\',                   1,                   0))                closure_transitioning,             SUM(                IF(                       action_log.object_pid <> 150                   AND je(action_log.data, ''template_id\') IN (527)                   AND je(action_log.data, \'name\') LIKE \'%Close Record%\'                   AND action_log.action_type = \'create\',                   1,                   0))                closure_total,             SUM(IF(    action_log.object_pid <> 150                    AND je(action_log.data, ''template_id\') IN (3114,                                                               1175,                                                               1120,                                                               656,                                                               651,                                                               559,                                                               553,                                                               533,                                                               510,                                                               505,                                                               489,                                                               482,                                                               455,                                                               440,                                                               172)                    AND action_log.action_type = \'create\',                    1,                    0))                assessments_created,             SUM(                IF(                       action_log.object_pid <> 150                   AND je(action_log.data, ''template_id\') IN (527)                   AND action_log.action_type = \'create\',                   1,                   0))                notes_created,             SUM(                IF(                       action_log.object_pid <> 150                   AND je(action_log.data, ''template_id\') IN (607)                   AND action_log.action_type = \'create\',                   1,                   0))                referrals_created,             SUM(                IF(                       action_log.object_pid <> 150                   AND je(action_log.data, ''template_id\') IN (607)                   AND action_log.action_type = \'delete\',                   1,                   0))                referrals_deleted,             SUM(                IF(                       action_log.object_pid <> 150                   AND je(action_log.data, ''template_id\') IN (607)                   AND action_log.action_type = \'update\',                   1,                   0))                referrals_updated,             SUM(                IF(                       action_log.object_pid <> 150                   AND je(action_log.data, ''template_id\') IN (289)                   AND action_log.action_type = \'create\',                   1,                   0))                family_members_created,             SUM(                IF(                       action_log.object_pid <> 150                   AND je(action_log.data, ''template_id\') IN (311)                   AND action_log.action_type = \'create\',                   1,                   0))                addresses_created      FROM action_log, rpt_clients c      WHERE    (c.clientid = action_log.object_id)            OR (c.clientid = action_log.object_pid)      GROUP BY locationid,               date(DATE_SUB(action_log.action_time, INTERVAL 6 HOUR))) c        ON     c.locationid = reports.locationid           AND date(reports.report_date) = date(c.report_date)     LEFT OUTER JOIN     (SELECT assessments.*,             (SELECT SUBSTR(rt.name, 1, LOCATE(\'-\', rt.name) - 1)              FROM rpt_clients rc, tree rt              WHERE     rt.template_id = 607                    AND rt.name NOT LIKE \'%-  []%\'                    AND rt.dstatus = 0                    AND rt.pid = rc.clientid                    AND rc.locationid = assessments.locationid                    AND date(rt.cdate) = date(assessments.assessment_date)              GROUP BY SUBSTR(rt.name, 1, LOCATE(\'-\', rt.name) - 1)              ORDER BY count(*) DESC              LIMIT 0, 1)                top_client_need,             (SELECT SUBSTR(rt.name, 1, LOCATE(\'-\', rt.name) - 1)              FROM rpt_clients rc, tree rt              WHERE     rt.template_id = 607                    AND rt.name NOT LIKE \'%-  []%\'                    AND rt.dstatus = 0                    AND rt.pid = rc.clientid                    AND rc.locationid = assessments.locationid                    AND date(rt.cdate) = date(assessments.assessment_date)              GROUP BY SUBSTR(rt.name, 1, LOCATE(\'-\', rt.name) - 1)              ORDER BY count(*) DESC              LIMIT 1, 1)                second_client_need,             (SELECT SUBSTR(rt.name, 1, LOCATE(\'-\', rt.name) - 1)              FROM rpt_clients rc, tree rt              WHERE     rt.template_id = 607                    AND rt.name NOT LIKE \'%-  []%\'                    AND rt.dstatus = 0                    AND rt.pid = rc.clientid                    AND rc.locationid = assessments.locationid                    AND date(rt.cdate) = date(assessments