L 6 HOUR) < client_date)                current_fema_tier_4      FROM (SELECT DISTINCT                   date(DATE_SUB(tree.action_time, INTERVAL 6 HOUR))                      client_date,                   rc.locationid            FROM action_log tree, rpt_clients rc, rpt_locations            WHERE     (   rc.clientid = tree.object_id                       OR rc.clientid = tree.object_pid)                  AND rpt_locations.locationid = rc.locationid) da,           rpt_clients,           rpt_locations      rl      WHERE     rl.locationid = rpt_clients.locationid            AND rl.locationid = da.locationid      GROUP BY client_date, rl.locationid) reports     LEFT OUTER JOIN     (SELECT locationid,             date(DATE_SUB(action_log.action_time, INTERVAL 6 HOUR))                report_date,             count(DISTINCT clientid)   disaster_survivors_served,             SUM(                IF(                       action_log.object_pid = 150                   AND action_log.action_type = \'create\'                   AND c.case_status NOT LIKE \'Information Only\',                   1,                   0))                new_open_cases,             SUM(                IF(                       action_log.object_pid = 150                   AND action_log.action_type = \'create\',                   1,                   0))                client_intake,             SUM(                IF(                       action_log.object_pid = 150                   AND action_log.action_type = \'create\'                   AND c.case_status LIKE \'Information Only\',                   1,                   0))                information_only,             SUM(                IF(                       action_log.object_pid = 150                   AND action_log.action_type = \'update\',                   1,                   0))                updated_client_records,             SUM(                IF(                       action_log.object_pid <> 150                   AND je(action_log.data, ''template_id\') IN (527)                   AND je(action_log.data, \'name\') LIKE                          \'%Close Record Repatriate has moved out of service area%\'                   AND action_log.action_type = \'create\',                   1,                   0))                closure_moved,             SUM(                IF(                       action_log.object_pid <> 150                   AND je(action_log.data, ''template_id\') IN (527)                   AND je(action_log.data, \'name\') LIKE                          \'%Close Record Disaster program deactivated%\'                   AND action_log.action_type = \'create\',                   1,                   0))                closure_deactivated,             SUM(                IF(                       action_log.object_pid <> 150                   AND je(action_log.data, ''template_id\') IN (527)                   AND je(action_log.data, \'name\') LIKE                          \'%Close Record Repatriate has withdrawn%\'                   AND action_log.action_type = \'create\',                   1,                   0))                closure_withdrawn,             SUM(                IF(                       action_log.object_pid <> 150                   AND je(action_log.data, ''template_id\') IN (527)                   AND je(action_log.data, \'name\') LIKE                          \'%Close Record Goals achieved%\'                   AND action_log.action_type = \'create\',                   1,                   0))                closure_achieved,             SUM(                IF(                       action_log.object_pid <> 150                   AND je(action_log.data, ''template_id\') IN (527)                   AND je(action_log.data, \'name\') LIKE                          \'%Close Record No longer able to contact%\'                   AND action_log.action_type = \'create\',                   1,                   0))                closure_nocontact,             SUM(       