           482,                                                               455,                                                               440,                                                               172)                    AND action_log.action_type = \'create\',                    1,                    0))                assessments_created,             SUM(                IF(                       action_log.object_pid <> 150                   AND je(action_log.data, ''template_id\') IN (527)                   AND action_log.action_type = \'create\',                   1,                   0))                notes_created,             SUM(                IF(                       action_log.object_pid <> 150                   AND je(action_log.data, ''template_id\') IN (607)                   AND action_log.action_type = \'create\',                   1,                   0))                referrals_created,             SUM(                IF(                       action_log.object_pid <> 150                   AND je(action_log.data, ''template_id\') IN (607)                   AND action_log.action_type = \'delete\',                   1,                   0))                referrals_deleted,             SUM(                IF(                       action_log.object_pid <> 150                   AND je(action_log.data, ''template_id\') IN (607)                   AND action_log.action_type = \'update\',                   1,                   0))                referrals_updated,             SUM(                IF(                       action_log.object_pid <> 150                   AND je(action_log.data, ''template_id\') IN (289)                   AND action_log.action_type = \'create\',                   1,                   0))                family_members_created,             SUM(                IF(                       action_log.object_pid <> 150                   AND je(action_log.data, ''template_id\') IN (311)                   AND action_log.action_type = \'create\',                   1,                   0))                addresses_created      FROM action_log, rpt_clients c      WHERE    (c.clientid = action_log.object_id)            OR (c.clientid = action_log.object_pid)      GROUP BY locationid,               date(DATE_SUB(action_log.action_time, INTERVAL 6 HOUR))) c        ON     c.locationid = reports.locationid           AND date(reports.report_date) = date(c.report_date)     LEFT OUTER JOIN     (SELECT assessments.*,             (SELECT SUBSTR(rt.name, 1, LOCATE(\'-\', rt.name) - 1)              FROM rpt_clients rc, tree rt              WHERE     rt.template_id = 607                    AND rt.name NOT LIKE \'%-  []%\'                    AND rt.dstatus = 0                    AND rt.pid = rc.clientid                    AND rc.locationid = assessments.locationid                    AND date(rt.cdate) = date(assessments.assessment_date)              GROUP BY SUBSTR(rt.name, 1, LOCATE(\'-\', rt.name) - 1)              ORDER BY count(*) DESC              LIMIT 0, 1)                top_client_need,             (SELECT SUBSTR(rt.name, 1, LOCATE(\'-\', rt.name) - 1)              FROM rpt_clients rc, tree rt              WHERE     rt.template_id = 607                    AND rt.name NOT LIKE \'%-  []%\'                    AND rt.dstatus = 0                    AND rt.pid = rc.clientid                    AND rc.locationid = assessments.locationid                    AND date(rt.cdate) = date(assessments.assessment_date)              GROUP BY SUBSTR(rt.name, 1, LOCATE(\'-\', rt.name) - 1)              ORDER BY count(*) DESC              LIMIT 1, 1)                second_client_need,             (SELECT SUBSTR(rt.name, 1, LOCATE(\'-\', rt.name) - 1)              FROM rpt_clients rc, tree rt              WHERE     rt.template_id = 607                    AND rt.name NOT LIKE \'%-  []%\'                    AND rt.dstatus = 0                    AND rt.pid = rc.clientid                    AND rc.locationid = assessments.locationid                    AND date(rt.cdate) = date(assessments.assessment_date)              GROUP BY SUBSTR(rt.name, 1, LOCATE(\'-\', rt.name) - 1)              ORDER BY count(*) DESC              LIMIT 2, 1)                third_client_need      FROM (SELECT rpt_locations.locationid,                   date(tree.cdate)                           assessment_date,                   SUM(IF(name NOT LIKE \'%-  []%\', 1, 0))     referrals_total,                   SUM(IF(name LIKE \'Behavioral Health%\', 1, 0))                      referrals_behavioral,                   SUM(IF(name LIKE \'Child%\', 1, 0))          referrals_child,                   SUM(IF(name LIKE \'Clothing%\', 1, 0))                      referrals_clothing,                   SUM(IF(name LIKE \'Employment%\', 1, 0))                      referrals_employment,                   SUM(IF(name LIKE \'FEMA%\', 1, 0))           referrals_fema,                   SUM(IF(name LIKE \'Financial%\', 1, 0))                      referrals_financial,                   SUM(IF(name LIKE \'Food%\', 1, 0))           referrals_food,                   SUM(IF(name LIKE \'Furniture%\', 1, 0))                      referrals_furniture,                   SUM(IF(name LIKE \'Health%\', 1, 0))                      referrals_health,                   SUM(IF(name LIKE \'Housing%\', 1, 0))                      referrals_housing,                   SUM(IF(name LIKE \'Language%\', 1, 0))                      referrals_language,                   SUM(IF(name LIKE \'Legal Services%\', 1, 0))                      referrals_legal,                   SUM(IF(name LIKE ''senior Services%\', 1, 0))                      referrals_senior,                   SUM(IF(name LIKE ''transportation%\', 1, 0))                      referrals_transportation            FROM rpt_clients, rpt_locations, tree            WHERE     template_id = 607                  AND name NOT LIKE \'%-  []%\'                  AND dstatus = 0                  AND pid =