ange_tier_31,             SUM(                CASE                   WHEN (real_old_value = 1328 AND new_value = 1325) THEN 1                   ELSE 0                END)                change_tier_41,             SUM(                CASE                   WHEN (real_old_value IS NOT NULL AND new_value = 1326)                   THEN                      1                   ELSE                      0                END)                change_tier_2,             SUM(                CASE                   WHEN (real_old_value = 1325 AND new_value = 1326) THEN 1                   ELSE 0                END)                change_tier_12,             SUM(                CASE                   WHEN (real_old_value = 1327 AND new_value = 1326) THEN 1                   ELSE 0                END)                change_tier_32,             SUM(                CASE                   WHEN (real_old_value = 1328 AND new_value = 1326) THEN 1                   ELSE 0                END)                change_tier_42,             SUM(                CASE                   WHEN (real_old_value IS NOT NULL AND new_value = 1327)                   THEN                      1                   ELSE                      0                END)                change_tier_3,             SUM(                CASE                   WHEN (real_old_value = 1325 AND new_value = 1327) THEN 1                   ELSE 0                END)                change_tier_13,             SUM(                CASE                   WHEN (real_old_value = 1326 AND new_value = 1327) THEN 1                   ELSE 0                END)                change_tier_23,             SUM(                CASE                   WHEN (real_old_value = 1328 AND new_value = 1327) THEN 1                   ELSE 0                END)                change_tier_43,             SUM(                CASE                   WHEN (real_old_value IS NOT NULL AND new_value = 1328)                   THEN                      1           