    DETERMINISTIC
    SQL SECURITY INVOKER
    COMMENT 'string'
BEGIN

	SET in_path = sfm_adjust_path(in_path, in_delimiter);

	RETURN (SELECT SUBSTRING_INDEX(SUBSTRING_INDEX(in_path, in_delimiter, in_element_index + 1), in_delimiter, -1));

END ;;
