CREATE DEFINER=`root`@`localhost` PROCEDURE `p_relationalize_data`()
BEGIN

   DROP TABLE IF EXISTS rpt_referrals;



   DROP TABLE IF EXISTS rpt_clients;



   DROP TABLE IF EXISTS rpt_locations;



   DROP TABLE IF EXISTS rpt_addresses;



   DROP TABLE IF EXISTS rpt_dependents;



   DROP TABLE IF EXISTS rpt_notes;



   DROP TABLE IF EXISTS rpt_tasks;



   DROP TABLE IF EXISTS rpt_supervisors;



   CREATE TABLE rpt_tasks

   AS

      SELECT objects.id taskid,

             je(objects.data, 'ecmrs_id') ecmrsid,

             je(objects.data, 'survivor_name') survivor_name,

             je(objects.data, 'time_expended') time_expended,

             je(objects.data, 'task_type') task_type,

             je(objects.data, 'task_status') task_status,

             je(objects.data, '_task') _task,

             je(objects.data, 'due_date') due_date,

             je(objects.data, 'due_time') due_time,

             je(objects.data, 'assigned') assigned,

             je(objects.data, 'importance') importance,

             je(objects.data, '_clientname') client_name,

             cdate,

             udate

        FROM objects, tree

        where tree.id = objects.id and 

        tree.template_id = 7;



   CREATE TABLE rpt_supervisors

   AS

        SELECT a.id SuperId,

               a.first_name SuperFirstName,

               a.last_name SuperLastName,

               a.data SuperData,

               b.id AssignedId,

               b.first_name,

               b.last_name,

               tasks._task,

               tasks.assigned

          FROM users_groups a

               INNER JOIN users_groups b ON LOCATE(b.id, a.data) > 0

               LEFT JOIN rpt_tasks tasks ON tasks.Assigned = b.id

      ORDER BY a.last_name, a.first_name;





   CREATE TABLE rpt_notes

   AS

      SELECT tree.id noteid,

             tree.pid clientid,

             data,

             sys_data

        FROM objects, tree

       WHERE     tree.id = objects.id

             AND tree.template_id = 527

             AND tree.dstatus = 0

             AND data <> '[]';







   CREATE TABLE rpt_dependents

   AS

      SELECT tree.id dependentid,

             je(objects.data, '_firstname') firstname,

             je(objects.data, '_lastname') lastname,

             je(objects.data, '_gender') gender,

             je(objects.data, '_birthdate') birthdate,

             je(objects.data, '_relationship') relationship,

             'Relationship Not Entered' relationshipname,

             je(objects.data, '_age') age,

             je(objects.data, '_ethnicity') ethnicity,

             je(objects.data, '_race') race,

             tree.pid clientid,

             je(objects.data, '_') locationregion,

             data,

             sys_data

        FROM objects, tree

       WHERE     tree.id = objects.id

             AND tree.template_id = 289

             AND tree.dstatus = 0

             AND data <> '[]';







   CREATE TABLE rpt_addresses

   AS

      SELECT tree.id addressid,

             je(objects.data, '_addressone') addressone,

             je(objects.data, '_city') city,

             je(objects.data, '_state') state,

             je(objects.data, '_zip') zip,

             tree.pid clientid,

             je(objects.sys_data, 'solr.femahotel_s') femahotel,

             je(objects.sys_data, 'solr.yesfemahotel_s') femahoteltype,

             je(objects.data, '_') locationregion,

             data,

             sys_data

        FROM objects, tree

       WHERE     tree.id = objects.id

             AND tree.template_id = 311

             AND tree.dstatus = 0;



   CREATE TABLE rpt_locations

   AS

      SELECT id locationid,

             je(objects.data, '_locationname') locationname,

             je(objects.data, '_locationtype') locationtype,

             je(objects.data, '_locationcity') locationcity,

             je(objects.data, '_locationstate') locationstate,

             je(objects.data, '_locationzipcode') locationzipcode,

             je(objects.data, '_locationcounty') locationcounty,

             je(objects.data, '_locationregion') locationregion

        FROM objects

       WHERE id IN (SELECT id

                      FROM tree

                     WHERE dstatus = 0 AND template_id = 3269);







   CREATE TABLE rpt_clients

   AS

      SELECT objects.id clientid,

             je(objects.data, '_firstname') firstname,

             je(objects.data, '_middlename') middlename,

             je(objects.data, '_lastname') lastname,

             je(objects.data, 'assigned') assigned,

             je(objects.data, '_gender') gender,

             je(objects.sys_data, 'county_s') county_s,

             je(objects.sys_data, 'zipcode_s') zipcode_s,

             je(objects.sys_data, 'case_status') case_status,

             je(objects.sys_data, 'fematier') fema_tier,

             je(objects.data, '_fulladdress') fulladdress_s,

             je(objects.data, '_femanumber') femanumber,

             je(objects.data, 'at_risk_population') at_risk_population,

             je(objects.data, '_phonenumber') phonenumber,

             je(objects.sys_data, 'closurereason_s') closure_reason,

             je(objects.sys_data, 'full_address') full_address,

             je(objects.sys_data, 'solr.locationother_s') locationother,

             je(objects.sys_data, 'solr.planstoreturn_s') planstoreturn,

             ifnull(je(objects.data, '_location_type.value'),

                    je(objects.data, '_location_type')) locationid,

             cdate,

             udate

        FROM objects, tree

       WHERE tree.id = objects.id AND dstatus = 0 AND template_id = 141;







   CREATE TABLE rpt_referrals

   AS

      SELECT objects.id

                referralid,

             je(objects.sys_data, 'solr.refferaltypename_s')

                refferaltype,

             je(objects.sys_data, 'solr.referralservicename_s')

                referralservice,

             je(objects.sys_data, 'solr.resourcename_s')

                resourcename,

             cdate,

             udate,

             data,

             sys_data,

             pid

                clientid

        FROM objects, tree

       WHERE tree.id = objects.id AND dstatus = 0 AND template_id = 607;







   ALTER TABLE rpt_referrals

      ADD CONSTRAINT pk_rpt_referrals PRIMARY KEY(referralid);



   ALTER TABLE rpt_clients

      ADD CONSTRAINT pk_rpt_clients PRIMARY KEY(clientid);



   ALTER TABLE rpt_locations

      ADD CONSTRAINT pk_rpt_locations PRIMARY KEY(locationid);



   ALTER TABLE rpt_dependents

      ADD CONSTRAINT pk_rpt_dependents PRIMARY KEY(dependentid);



   ALTER TABLE rpt_notes

      ADD CONSTRAINT pk_rpt_notes PRIMARY KEY(noteid);



   ALTER TABLE rpt_tasks

      ADD CONSTRAINT pk_rpt_tasks PRIMARY KEY(taskid);

END ;;
